- input: "TEXT\x1CC00131185\x1C25971931\x1C\x1CF3XA\x1C\"This June 20 Monthly Report
    was amended previously to correct the disbursement year for the 2008 General Election
    for contributions to several candidates.  On this amended report, (2) contributions
    have corrected to reflect the 2010 primary election.  This Committee does disclose
    the identification of all individuals who contribute in excess of $200 in a calendar
    year.  If contributor information is missing, the Committee does in fact demonstrate
    'Best Efforts' when obtaining missing information.  The following is a detailed
    description of the Committee's 'best efforts' procedures: First, All of the Committee's
    original solicitations do include a clear and conspicuous request for contributor
    information and does inform the contributor of the requirements of federal law
    for reporting such information; Second, if the information is not provided by
    the contributor, the Committee does make one follow-up, stand alone effort to
    obtain this information regardless of whether the contribution was solicited or
    not.  This written effort normally occurs within five days after receipt of the
    contribution.  The request clearly ask for the following information: 1. Clearly
    asks for missing information, without soliciting a contribution, 2. Inform the
    contributor of the requirements of federal law for the reporting of such information,
    and 3. Since the request is written, it does include a pre-addressed return envelope.
    Third, once the Committee receives contributor information after the contribution
    has been reported, it will file on or before its next regularly scheduled reporting
    date, amendments to the report orginally disclosing the contribution. The Committee
    will also make 'best efforts' to obtain inadequate occupation and employer information,
    as it does with missing information.\""
